import React,{Component} from "react";

class DrawSheet extends Component{
    render(){
        return (
            <div>
                <input type={file} onChange={()=>{
                    const file=e.target.files[0];
                    readExcel(file)
                }}>
                </input>
            </div>
        )}}
export default DrawSheet;
